import React from 'react';
import  './App.css';
import TextAnm from './TextAnim';
import web from './coding.png';
import menu from './hamburger.png';
import logo from './facebook.png';
import logo1 from './instagram.png';
import logo2 from './twitter.png';
import logo3 from './linkedin.png';
import logo4 from './arrow-right.png';

export default function App(){

    function show(){
      const js = document.createElement("p").innerHTML="Check out My Portfolio";
      return js;
    }

    return(
        <>
        <div className="navbar">
            <img className='web' src={web} alt="image" />
            <img className='menu' src={menu} alt="image" />
        </div>
        <div className="about">
        <h3 className='text1'> Hello My Name is <TextAnm /> </h3>
        <h1>I am Full Stack <span style={{color:"tomato"}}>Web Developer</span> , FrontEnd specialist </h1>
        <h2>Check out my portfolio and projects</h2>
        <h3>If you do like , contact me and let's work together</h3>
        </div>
        <div className="links">
            <img className='img' src={logo} alt="" />
            <img className='img' src={logo1} alt="" />
            <img className='img' src={logo2} alt="" />
            <img className='img' src={logo3} alt="" />
            </div>
            <div className="arrow"  onMouseEnter={show}>
                <p id='arrow'>CheckOut My Portfolio</p>
                <img  src={logo4} alt="image" />
            </div>
            <div className="footer">
                <button>CheckOut</button>
            </div>
        </>
    )
}
